import React from "react";

const Contacts = () => {
  return (
    <>
      <h2>Contacts</h2>
      <ul>
        {state.Contacts.map((contact) => (
          <li key={contact.id}>{contact.name}</li>
        ))}
      </ul>
    </>
  );
};

export default Contacts;
